function applyFuncOnArray(arr, func) { 
    let res = [];
    for (let j = 0; j < arr.length; j++) 
    {res.push(func(arr[j]));}
        return res;}
    
function applyFilter(arr, func) { 
    let res = [];
    for (let i = 0; i < arr.length; i++) { let element = arr[i];
        if (func(element)) { res.push(element);}} 
        return res; }

function applyMap(arr, func) { 
    let res = [];
    for (let i of arr)
      { res.push(func(i)); }
        return res; }

function applyMap(arr, func) { 
    let res = [];
    for (let i of arr) { res.push(func(i));} 
        return res; }

function applySome(arr, func) {
    for (let i = 0; i < arr.length; i++) {
        if (func(arr[i])) {
            return true;}}
        return false;}

function applyEvery(arr, func) {
    for (let i = 0; i < arr.length; i++) {
        if (!func(arr[i])) {
            return false;}}
        return true;}

function applyFind(arr, func) {
    for (let i = 0; i < arr.length; i++) {
        if (func(arr[i])) {
            return arr[i];}}
        return undefined;}

function applyFindIndex(arr, func) {
    for (let i = 0; i < arr.length; i++) {
        if (func(arr[i])) {
            return i; }}
        return -1;}

function applyJoin(arr, char = ",") {
    let result = "";
    for (let i = 0; i < arr.length; i++) {
        result += arr[i];
        if (i < arr.length - 1) {
        result += char;}}
        return result;}

function applyReduce(arr, func, initialValue) {
    let currentValue;
    let i;
    if (initialValue !== undefined) {
        currentValue = initialValue;
        i = 0;
    } else {
        currentValue = arr[0];
        i = 1;}
    for (; i < arr.length; i++) {
        currentValue = func(currentValue, arr[i]);}
        return currentValue;}

function getEmails(users) {
    let emails = users.map(user => user.email);
        return emails;}

function iranianNames(users) {
    let iranianUsers = users.filter(user => user.country == "Iran");
    let names = iranianUsers.map(user => user.firstName + " " + user.lastName);
        return names;}

function nonBinaryBalance(users) {
    let nonBinaryBalance = users.filter(user => user.gender == "Non-binary");
    let res = nonBinaryBalance.reduce((acc, user) => acc + user.balance, 0);
        return res;}
        
function richAmericansEmails(users) {
    let richAmericans = users.filter(user => user.country == "USA" && user.balance > 500000);
    let emails = richAmericans.map(user => user.email);
        return emails;}
                        
function iraniansBalance(users) {
    let iranians = users.filter(user => user.country == "Iran");
    let sortedIranians = iranians.sort((a, b) => b.balance - a.balance);
        return sortedIranians;}
        
function longEmail(users) {
    let longEmailUsers = users.filter(user => user.email.length > 30);
    let names = longEmailUsers.map(user => user.first_name + " " + user.last_name);
        return names;}

function getEduUsersBalances(users) {
    let eduUsers = users.filter(user => user.email.endsWith(".edu"));
    let balances = eduUsers.map(user => user.balance);
        return balances;}

function femaleUsersReduse(users) {
    return users.reduce((count, user) => {
      if (user.gender === "female") {
        return count + 1;}
      else {
        return count;}}, 0);}

function femaleUsersFor(users) {
    let count = 0;
    for (let i = 0; i < users.length; i++) {
      if (users[i].gender === "female") {
        count++;
      }}
        return count;}

function maleBalanceReduce(users) { 
    let maleUsers = users.filter(user => user.gender === "Male");
    let totalBalance = maleUsers.reduce((sum, user) => sum + user.balance, 0);
        return totalBalance;}

function maleBalanceFor(users) {
    let maleUsers = users.filter(user => user.gender ===" Male"); 
    let totalBalance = 0; 
    for (let i = 0; i < maleUsers.length; i++) 
        { totalBalance += maleUsers[i].balance; } 
        return totalBalance;}

function marchUsers(users) {
    let today = new Date(); let names = [];
    for (let i = 0; i < users.length; i++) 
        { let birthDate = new Date(users[i].birthDate);
        let age = today.getFullYear() - birthDate.getFullYear();
        if (age >= 18 && birthDate.getMonth() === 2)
            { names.push(users[i].firstName + " " + users[i].lastName);}} 
        return names;}


